create table borrowing_returning
(
    id           BIGINT(19) auto_increment
        primary key,
    get_time     BIGINT(19)   null,
    repay_time   BIGINT(19)   null,
    article_id   BIGINT(19)   null,
    create_time  BIGINT(19)   null,
    ma_open_id   VARCHAR(255) null,
    number       VARCHAR(255) null,
    jurisdiction BIGINT(19)   null
)
    collate = utf8_bin;

